import React, { useState, useEffect } from "react";
import sourcesData from "../data/datasources.json";
import toolsData from "../data/tools.json";
import teamData from "../data/teaminfo.json";
import "../styles/about.css";

function About() {
  const [totalCommits, setTotalCommits] = useState(0);
  const [totalIssues, setTotalIssues] = useState(0);
  const [commitsFetched, setCommitsFetched] = useState(false);
  const [issuesFetched, setIssuesFetched] = useState(false);

  const commitsUrl =
    "https://gitlab.com/api/v4/projects/59212893/repository/contributors";
  const issuesUrl =
    "https://gitlab.com/api/v4/projects/59212893/issues?per_page=100";
  const headers = {
    "PRIVATE-TOKEN": "glpat-TaBkMeTCfWtJXpf6mDKx",
  };

  async function fetchCommits() {
    try {
      const response = await fetch(commitsUrl, { headers });
      const data = await response.json();

      let commits = 0;
      data.forEach((member) => {
        const teamMember = teamData.find(
          (teamMember) => teamMember.email === member.email
        );
        if (teamMember && member.commits) {
          teamMember.commits = member.commits;
          commits += member.commits;
        }
      });

      setTotalCommits(commits);
      setCommitsFetched(true);
    } catch (error) {
      console.error("Error fetching commits:", error);
    }
  }

  async function fetchIssues() {
    try {
      const response = await fetch(issuesUrl, { headers });
      const data = await response.json();

      let totalIssuesCnt = 0;
      let seenSet = new Set();
      data.forEach((issue) => {
        const teamMember = teamData.find(
          (teamMember) => teamMember.gitlab_id === issue.author.username
        );
        if (teamMember) {
          if (!seenSet.has(teamMember.gitlab_id)) {
            seenSet.add(teamMember.gitlab_id);
            teamMember.issues = 0;
          }
          teamMember.issues += 1;
          totalIssuesCnt += 1;
        }
      });
      setTotalIssues(totalIssuesCnt);
      setIssuesFetched(true);
    } catch (error) {
      console.error("Error fetching issues:", error);
    }
  }

  useEffect(() => {
    if (!commitsFetched) {
      fetchCommits();
    }
    if (!issuesFetched) {
      fetchIssues();
    }
  }, [commitsFetched, issuesFetched]);

  return (
    <div className="container-fluid px-4 py-5">
      <h1 className="about-header">Our Team</h1>
      <div className="row about-row">
        {teamData.map((member) => (
          <div className="col-md-4 card" key={member.name}>
            <img
              src={member.img_src}
              className="card-img-top about-img"
              alt={member.name}
            />
            <div className="card-body">
              <h5 className="card-title">{member.name}</h5>
              <h6 className="text-muted">Role: {member.role}</h6>
              <p className="card-text">{member.description}</p>
              <p>Issues: {member.issues || 0}</p>
              <p>Commits: {member.commits || 0}</p>
              <p>Unit Tests: {member.unit_tests}</p>
            </div>
          </div>
        ))}
      </div>
      <center style={{ marginTop: "20px" }}>
        <h5>
          <strong>
            Total Commits: {totalCommits} <br />
            Total Issues: {totalIssues}
          </strong>
        </h5>
      </center>
      <div>
        <h1 className="about-header mb-3">Tools Used</h1>
        <div className="row tool-grid">
          {toolsData.map((tool) => (
            <div className="col-md-4 card tool-card" key={tool.name}>
              <img
                src={tool.img_src}
                className="card-img-top tool-card-img mt-4"
                alt={tool.name}
              />
              <div className="card-body">
                <h5 className="card-title">{tool.name}</h5>
                <p className="card-text">{tool.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
      <div className="container px-4 py-5" id="featured-3">
        <h2 className="pb-2 border-bottom">Data Sources</h2>
        <div className="row g-4 py-5 row-cols-1 row-cols-lg-3">
          {sourcesData.data_sources.map((source, index) => (
            <div className="feature col" key={index}>
              <div className="feature-icon d-inline-flex align-items-center justify-content-center text-bg-primary bg-gradient fs-2 mb-3">
                <svg className="bi" width="1em" height="1em">
                  <use xlinkHref="#collection"></use>
                </svg>
              </div>
              <h3 className="fs-2 text-body-emphasis">Source {index + 1}</h3>
              <p>External data source link for the project.</p>
              <a href={source} target="_blank" rel="noopener noreferrer" className="icon-link">
                Visit Source
                <svg className="bi">
                  <use xlinkHref="#chevron-right"></use>
                </svg>
              </a>
            </div>
          ))}
          <div className="feature col">
            <div className="feature-icon d-inline-flex align-items-center justify-content-center text-bg-primary bg-gradient fs-2 mb-3">
              <svg className="bi" width="1em" height="1em">
                <use xlinkHref="#people-circle"></use>
              </svg>
            </div>
            <h3 className="fs-2 text-body-emphasis">Postman API</h3>
            <p>API documentation and collections for the project.</p>
            <a
              href="https://software-engineering-3016.postman.co/workspace/Software-Engineering-Workspace~3f64ce8f-8b3b-487e-a067-56d3a2e3d512/collection/36528627-9970bfc9-552b-4d2f-9543-d02690a67499?action=share&creator=36528627"
              target="_blank"
              rel="noopener noreferrer"
              className="icon-link"
            >
              Visit Postman API
              <svg className="bi">
                <use xlinkHref="#chevron-right"></use>
              </svg>
            </a>
          </div>
          <div className="feature col">
            <div className="feature-icon d-inline-flex align-items-center justify-content-center text-bg-primary bg-gradient fs-2 mb-3">
              <svg className="bi" width="1em" height="1em">
                <use xlinkHref="#toggles2"></use>
              </svg>
            </div>
            <h3 className="fs-2 text-body-emphasis">GitLab Info</h3>
            <p>Repository and documentation for the project.</p>
            <a href="https://gitlab.com/diegocampos2/cs373-idb" target="_blank" rel="noopener noreferrer" className="icon-link">
              Visit GitLab Repo
              <svg className="bi">
                <use xlinkHref="#chevron-right"></use>
              </svg>
            </a>
            <a
              href="https://gitlab.com/diegocampos2/cs373-idb/-/wikis/Home-Hattrick?redirected_from=home"
              target="_blank"
              rel="noopener noreferrer"
